descriptor.controllerScript:
let boilerGaugeNeedle;
let mainEngGaugeNeedle;
let lubricantOilGaugeNeedle;

let sensors = [];
let firstUpdate = false;
let alarmStarted = false;

const audioCtx = new AudioContext();
const osc = audioCtx.createOscillator();

self.onInit = function() {
    const ctx = self.ctx;
    const settings = ctx.settings;
    const $scope = ctx.$scope;

    // console.log(audioCtx)
    const entityId = ctx.datasources[0].entity.id;
    const entityName = ctx.datasources[0].entity.name;
    const entityLabel = ctx.datasources[0].entity.label;

    ctx.detectChanges(true);

    osc.type = "sine";

    // console.log(osc);
    // console.log("rect", $("#boiler-temp-data-btn")[0].getBBox())

    window.onclick = function(){
        // console.log("window clicked")
        if(alarmStarted){
            osc.stop();
            osc.disconnect();
            alarmStarted = false;
        }
    };

    $scope.openSettings = function(){
        const params = {
            entityName,
            entityLabel,
            // targetEntityParamName: string,
            entityId
        };
        ctx.stateController.updateState("asyad_alarm_settings", params);
    };

    $scope.openSensorDataState = function($event, sensor){
        // console.log($event, sensor);
        switch (sensor) {
            case "BOILER":
                ctx.stateController.updateState("boiler_sensor_data", {});
                break;
            case "MAIN_ENGINE":
                ctx.stateController.updateState("main_engine_sensor_data", {});
                break;
            case "LUBRICANT_OIL":
                ctx.stateController.updateState("lubricant_oil_sensor_data", {});
                break;
            default:
                // code
        }
    };

    sensors = [
        {
            tempTelemetryKey: settings.boilerTempKey,
            statusTelemetryKey: "madaxStatus2",
            thresholdAttrKey: "boilerTempThresh",
            tempValue: 0,
            maxTempValue: 800,
            minTempValue: 0,
            threshold: 700,
            elements: {
                value: $("#boiler-temp-value"),
                needle: $("#boiler-temp-gauge-needle"),
                arc: $("#boiler-temp-gauge-arc"),
                thermo: $("#boiler-temp-gauge-thermo"),
                threshIndicator: $("#boilder-temp-threshold-indicator"),
                valueBox: $("#boiler-temp-box"),
                line: $("#boiler-temp-line"),
                trendsBtn: $("#boiler-temp-data-btn")
            },
            gaugeCenter: {
                x: 513.64,
                y: 783.5102
            },
            // connected: 0
        },
        {
            tempTelemetryKey: settings.mainEngTempKey,
            statusTelemetryKey: "madaxStatus3",
            thresholdAttrKey: "mainEngTempThresh",
            tempValue: 0,
            maxTempValue: 800,
            minTempValue: 0,
            threshold: 400,
            elements: {
                value: $("#main-eng-temp-value"),
                needle: $("#main-eng-temp-gauge-needle"),
                arc: $("#main-eng-temp-gauge-arc"),
                thermo: $("#main-eng-temp-gauge-thermo"),
                threshIndicator: $("#main-eng-temp-threshold-indicator"),
                valueBox: $("#main-eng-temp-box"),
                line: $("#main-eng-temp-line"),
                trendsBtn: $("#main-eng-temp-data-btn")
            },
            gaugeCenter: {
                x: 992.648,
                y: 783.5102
            },
            // connected: 0
        },
        {
            tempTelemetryKey: settings.lubricantOilTempKey,
            statusTelemetryKey: "madaxStatus3",
            thresholdAttrKey: "lubricantOilTempThresh",
            tempValue: 0,
            maxTempValue: 1400,
            minTempValue: 0,
            threshold: 400,
            elements: {
                value: $("#lubricant-oil-temp-value"),
                needle: $("#lubricant-oil-temp-gauge-needle"),
                arc: $("#lubricant-oil-temp-gauge-arc"),
                thermo: $("#lubricant-oil-temp-gauge-thermo"),
                threshIndicator: $("#lubricant-oil-temp-threshold-indicator"),
                valueBox: $("#lubricant-oil-temp-box"),
                line: $("#lubricant-oil-temp-line"),
                trendsBtn: $("#lubricant-oil-temp-data-btn")
            },
            gaugeCenter: {
                x: 1471.6428,
                y: 783.5102
            },
            // connected: 0
        }
    ];

    sensors.forEach(function(sensor){
        const {elements, gaugeCenter} = sensor;

        const transformCSS = {
            transition: "transform 300ms ease",
            "transform-box": "view-box",
            "transform-origin": `${Math.round(gaugeCenter.x)}px ${Math.round(gaugeCenter.y)}px`,
        };

        elements.needle.css(transformCSS);
        elements.threshIndicator.css(transformCSS);

        const groupBBox = elements.trendsBtn[0].getBBox();
        // console.log(sensor.tempTelemetryKey, "box", groupBBox);
        const groupRect = elements.trendsBtn.children("rect").first();

        if(groupRect.length > 0){
            groupRect.attr("x", groupBBox.x);
            groupRect.attr("y", groupBBox.y);
            groupRect.attr("width", groupBBox.width);
            groupRect.attr("height", groupBBox.height);
        }
        // console.log("rect", groupRect);
    });

    const thresholdAttrKeys = sensors.map(function(sensor){return sensor.thresholdAttrKey});

    if(ctx.datasources[0].entityName !== "function")
        ctx.attributeService.getEntityAttributes(entityId, "SERVER_SCOPE", thresholdAttrKeys).subscribe(function(attributes){
            // console.log("attributes", attributes);
            sensors.forEach(function(sensor){
                const thresholdAttr = attributes.find(function(attr){
                    return attr.key === sensor.thresholdAttrKey;
                });

                if(thresholdAttr) sensor.threshold = thresholdAttr.value;

                const { threshold, elements, maxTempValue, minTempValue } = sensor;
                // Offest is applied because threshold indicator's angle is starting from 90deg unlike the gauge's needle
                const threshOffset = minTempValue + ((maxTempValue - minTempValue) / 2); // Middle value

                rotateAroundGaugeCenter(threshold - threshOffset , maxTempValue, minTempValue, elements.threshIndicator);
            });

        });
};

self.onDataUpdated = function() {
    const ctx = self.ctx;

    if(!firstUpdate && ctx.datasources[0].entityName !== "function"){
        const fullscreenBtn = $("button").filter(function(_, element){
            // console.log($(element).children("mat-icon"))
            const parent = element.parentElement;
            // console.log("parent", parent);
            return $(element).text() === "fullscreen" && $(parent).hasClass("tb-widget-actions");
        }).first();

        fullscreenBtn.trigger("click");
        fullscreenBtn.hide();

        firstUpdate = true;
    }

    sensors.forEach(function(sensor){
        const tempTelemetryData = ctx.data.find(function(dPoint){
            return dPoint.dataKey.name === sensor.tempTelemetryKey;
        });

        if(tempTelemetryData) sensor.tempValue = tempTelemetryData.data[0][1];

        const {
            elements, 
            threshold, 
            tempValue, 
            maxTempValue, 
            minTempValue,
            statusTelemetryKey
        } = sensor;

        const isTempBelowMin = tempValue < minTempValue;
        const isTempBeyondMax = tempValue > maxTempValue;
        const isTempBeyondThreshold = tempValue >= threshold;
        const isTempInSafeLimits = tempValue < threshold && tempValue >= minTempValue;


        if(isTempBeyondMax){
            elements.value.text(Math.round(maxTempValue));
            rotateAroundGaugeCenter(maxTempValue, maxTempValue, minTempValue,elements.needle);
        }else if(isTempBelowMin){
            elements.value.text(Math.round(minTempValue));
            rotateAroundGaugeCenter(minTempValue, maxTempValue, minTempValue, elements.needle);
        }else{
            elements.value.text(Math.round(tempValue));
            rotateAroundGaugeCenter(tempValue, maxTempValue, minTempValue,elements.needle);
        }

        if(isTempBeyondMax || isTempBeyondThreshold){
            elements.thermo.children().css({fill: "#c21330"});
            elements.arc.css({fill: "#c21330"});
            elements.value.css({fill: "#c21330"});

            if(!alarmStarted){
                osc.connect(audioCtx.destination);
                osc.start();
                alarmStarted = true;
            }
        }else if(isTempInSafeLimits){
            elements.thermo.children().css({fill: "#2d8d79"});
            elements.arc.css({fill: "#2d8d79"});
            elements.value.css({fill: "#033a3f"});

            // if(alarmStarted){
            //     osc.stop();
            //     alarmStarted = false;
            // }
        }else{ //Temp is below zero
            elements.thermo.children().css({fill: "#878787"});
            elements.arc.css({fill: "#878787"});
            elements.value.css({fill: "#878787"});
        }

        const statusTelemetryData = ctx.data.find(function(dPoint){
            return dPoint.dataKey.name === statusTelemetryKey;
        });

        if(!statusTelemetryData) return;

        const isConnected = statusTelemetryData.data[0][1] === 1 || statusTelemetryData.data[0][1] === "1";

        if(isConnected === true){
            elements.line.css({stroke: "#2d8d79"});
            elements.valueBox.css({stroke: "#2d8d79"});
        }else{
            elements.line.css({stroke: "#c21330"});
            elements.valueBox.css({stroke: "#c21330"});
        }
    });
};

const rotateAroundGaugeCenter = function(tempValue, maxTempValue, minTempValue, element){
    // NOTE: The angle is calculated with the assumption that min temperature is 0
    const angle = Math.round(tempValue * 180 / maxTempValue);

    element.css({transform: `rotate(${angle}deg)`});
};

self.onResize = function() {};

self.onDestroy = function() {};

